import styled from "@emotion/styled";

export const Header = styled.p`
  display: flex;
  align-items: center;
  width: 100%;
  margin-bottom: 70px;
  span {
    padding-top: 4px;
    font-size: 22px;
    font-weight: bold;
  }
  div {
    margin-left: 40px;
  }
`;

export const BoxOfficeWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
`;

export const BoxOfficeMovieCard = styled.div`
  display: flex;
  flex-wrap: wrap;
  width: 100%;
`;

export const periodButtonWrapper = styled.div`
  display: flex;
  flex-direction: column;
`;
